import { Button, TextField, Typography } from "@mui/material";
import { Field, Formik } from "formik";
import React from "react";
import { Form, useNavigate } from "react-router-dom";
const initialValues = {
  fullName: "",
  email: "",
  password: "",
  role: "ROLE_CUSTOMER",
};
const RegisterForm = () => {
  const Navigate = useNavigate();
  const handleSubmit = () => {};
  return (
    <div>
      <Typography variant="h5" className="text-center">
        login
      </Typography>
      <Formik initialValues={initialValues} onSubmit={handleSubmit}>
        <Form>
          <Field
            as={TextField}
            name="fullName"
            label="fullName"
            fullWidth
            margin="normal"
          />
          <Field
            as={TextField}
            name="email"
            label="email"
            fullWidth
            margin="normal"
          />
          <Field
            as={TextField}
            name="password"
            label="password"
            fullWidth
            margin="normal"
          />
          <Field
            as={TextField}
            name="Role"
            label="Role"
            fullWidth
            margin="normal"
          />
          <Button
            fullWidth
            type="submit"
            variant="contained"
            className=""
            sx={{ mt: 2, padding: "1rem" }}
          >
            login
          </Button>
        </Form>
      </Formik>
      <Typography variant="body2" align="center" sx={{ mt: 3 }}>
        Don't have Account ?
        <Button onClick={() => Navigate("/account/register")} size="small">
          Login
        </Button>
      </Typography>
    </div>
  );
};

export default RegisterForm;
